      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"Can I submit an article as a normal DZone community member?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, you absolutely can, and we encourage you to do so! We work with a large variety of authors — MVBs who keep up their own personal blogs, MVBs that blog on various company blogs, MVBs that post exclusive content on DZone, Zone Leaders who both write and curate posts for DZone, non-MVB individuals whom we contact directly to post articles on specific topics, and normal DZone community members who submit articles directly to us. All of our contributors are important to us, no matter what the status of their DZone membership is.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What is an MVB?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"MVB stands for Most Valuable Blogger. What does this mean? Well, if you are a developer and have a blog and write awesome, high-quality content, you could be a candidate for the MVB program!\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Why should I contribute to DZone?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"The better question is why wouldn't you? There are so many benefits to contributing to our site. Not only will you receive extra exposure, but you are actually reaching a global audience! By contributing to DZone, you are sharing your knowledge and expertise with other developers as well as growing your reputation in your field.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Can I post somebody else's article?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"You can, as long as you have their permission. When you fill out the \\\"Author\\\" section on the upper right-hand side of the article editor, you can credit authors other than yourself. If you are going to post in someone else's name, make sure that person has a DZone account so that you can correctly attribute the article to said person.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"How does moderation work and how long does it take for a submitted article to go live?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Once you click on \\\"Submit to Moderation,\\\" your article will be added to our editorial team's moderation queue. A member of the team will review your article to make sure it's a good fit for our audience — they'll check how relevant it is and if there are any specific content or grammatical issues.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Will you link my post on DZone back to my website?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes! If your post exists elsewhere on the web, please link to it. It's really important that we credit where the post originally came from.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Can I edit my post after it has already been published?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, but try to do so sparingly! If you decide you would like to edit your post after it's already been posted, you can do so by clicking on the gear that sits beside the number of pageviews underneath your article title. However, doing so will send your post back into moderation for our Editorial team to assess the changes you've made.\"\n    }\n  }]\n}\n\u003C\/script\u003E",
