      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"What is Keycloak?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Keycloak is a tool for Identity and Access Management.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Is Keycloak free?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, as for now Keycloak is open-source and has Apache License 2.0.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Which security protocols are supported by Keycloak?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"As for now Keycloak supports OpenID Connect, OAuth 2.0 and SAML 2.0.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Does Keycloak support SSO?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, Keycloak support both Single Sign-On and Single Sign-Out.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What are current Keycloak distributions?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"As for now, Keycloak has 3 different distributions: Server, Docker image and Operator.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"How can I integrate Keycloak?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Keycloak provides API and client library which you can use in your application. Additionally, there are several implementations of this library in many different languages.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Is there a tool like Keycloak with enterprise support?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Keycloak is an upstream project for Red-hat SSO so I recommend checking it.\"\n    }\n  }]\n}\n\u003C\/script\u003E",
